import React, {  useState } from "react";
import "./contractus.css";
import Chatbot from "../components/chatbot";
import NavbarPage from "../components/navnew";
const Contractus = () => {
  const [showDropdown, SetshowDropdown] = useState(true);
  const Hiddendropdown = () => {
    SetshowDropdown(false);
  };
  return (
    <div onClick={() => Hiddendropdown()}>
      <NavbarPage
        SetshowDropdown={SetshowDropdown}
        showDropdown={showDropdown}
      />
      <h1 className="h1-contractus">ติดต่อเรา</h1>
      <div className="container1-contract">
        <div className="column-contract contact">ช่องทางการติดต่อ</div>
        <div className="column-contract developer">ทีมผู้จัดทำ</div>
        <div className="line-contract"></div>
      </div>
      <div className="container2-contract">
        <div className="column2-contract">aaaa
          {/* <iframe className="map-contract" src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3877.1083911253977!2d100.494455214653!3d13.651169990412644!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x30e2a251bb6b0cf1%3A0xf656e94ff13324ad!2sKing%20Mongkut&#39;s%20University%20of%20Technology%20Thonburi!5e0!3m2!1sth!2sth!4v1613653445252!5m2!1sth!2sth"></iframe> */}
        </div>
        <div className="column2-contract address">
          <div className="address-contract">
            มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี <br/>
            126  ถนนประชาอุทิศ แขวงบางมด <br/>
            เขตทุ่งครุ กรุงเทพฯ 10140 <br/>
            โทรศัพท์ 02-470-8000 <br/>
            Email monkey_fraud@gmail.com
          </div>
          
        </div>
      </div>
      <Chatbot />
    </div>
  );
};

export default Contractus;
